  [],\n\t\"revision_timestamp\": \"2016-07-27T22:20:24.836759\",\n\t\"name\": \"the-breeding-ecology-of-white-faced-ibis-in-the-carson-river-basin-nevada\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"To ensure long-term breeding population
  viability of White-faced Ibis, it may be necessary to develop local water management
  strategies with consideration of habitat and population trends throughout the Great
  Basin. The goal of this study is to examine, in detail, and over a three-year period,
  the breeding ecology of White-faced Ibis at one of the major and persistent colonies
  in the  Great Basin: the Carson River Basin colony in Nevada. Information gained
  from this study will be used to assess the importance of local water and habitat
  management at breeding colony sites, and the importance of the Carson River Basin
  marshes to the Great Basin White-faced Ibis population. With this in mind, the specific
  objectives of this study during the 1995 season were  to: I) determine juvenile
  recruitment and survival, 2) quantify nest site characteristics and determine important
  factors in nest site selection, and 3) determine movements of juveniles and adults
  during the post-breeding period.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
